import React,{useState, useEffect} from 'react';
import { NavLink } from 'react-router-dom';
import { useSelector,useDispatch } from 'react-redux';
import { TfiViewListAlt } from "react-icons/tfi";

import classes from '../navbar/pages/MainNavigation.module.css';
import { cardbuttonsActions } from '../store';

function Wishlistnavbutton() {
  return (
    <>
    <NavLink to="/wishlist" activeClassName={classes["wishlistnav-active"]}>
      <TfiViewListAlt className={classes.wishlistnav} />
    </NavLink>
      <span className={classes["icon-buttonbadge"]}>
        {localStorage.getItem('wishlistSize') || 0}
      </span>
    </>
  );
}

export default Wishlistnavbutton;
